import "./Footer.scss";

const Footer = () => {
    return (
        <div>
            <div className="links">
                <div className="logo">Feyman</div>
                <div className="contact"></div>
                <div className="quick-links"></div>
            </div>
            <div className="copyright"></div>
        </div>
    );
};

export default Footer;
